    paddingTop: "120px",
    paddingBottom: "240px"
  },
  h1: {
    margin: "0px",
    color: "white",
    paddingRight: "24%",
    opacity: "0.6"
  },
  p1: {
    padding: "16px 0px",
    color: "white",
    fontSize: "16px",
    opacity: "0.6"
